B.IW=new A.aW("Como softwarehouse, tenho que lidar com novos desafios todos os dias.\n\nTrabalhei em um projeto de software de back office que fomos respons\xe1veis por gerenciar as informa\xe7\xf5es dos clientes como seu estoque, suas informa\xe7\xf5es fiscais, gerar relat\xf3rios sobre as vendas, etc. Para esse projeto usamos Java6, OracleDB e SQLServer.\n\nOutro \xe9 um software gerenciador de dep\xf3sitos, usado principalmente nos dep\xf3sitos da Amazon no Brasil, onde somos respons\xe1veis por melhorar e acompanhar cada passo desde o armazenamento at\xe9 o envio dos produtos cadastrados no sistema, e gerar relat\xf3rios sobre suas etapas. Tamb\xe9m temos m\xf3dulos respons\xe1vel por integrar as bases de dados dos clientes com as nossas. Para isso usamos Java8 e OracleDB.\n\nAtualmente estou em um projeto para uma empresa de recupera\xe7\xe3o de cr\xe9ditos. Para este projeto, precisamos manter as informa\xe7\xf5es de clientes, informa\xe7\xf5es de devedores, balan\xe7o dos gastos em rela\xe7\xe3o a cada cliente, gera\xe7\xe3o de notas fiscais e boletos para os clientes pagarem pelos servi\xe7os prestados. Para este projeto, utilizamos ReactJS, Java SpringBoot e Banco de dados SQLServer.",null,null,null)
